import React, { useState } from 'react';
import './sidebar.css';
import * as FaIcons from "react-icons/md";
import * as BiIcons from "react-icons/bi";
import { Link } from 'react-router-dom';
import { SidebarData } from './SidebarData';
import './sidebar.css';
import { IconContext } from 'react-icons';

function NavbarSidebar() {
    const [sidebar, setSidebar] = useState(false); //false = not showing

    const showSidebar = () => setSidebar(!sidebar); //reverse true/false values when onClick runs

    return (
        <div>
            <IconContext.Provider value={{ color: '#ffff'}}>
            <div className="navbar">
                <Link to='#' className='menu-bars'>
                <BiIcons.BiLeftArrow onClick={showSidebar}/>
                </Link>
            </div>
            <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}> 
                <ul className='nav-menu-items' onClick={showSidebar}>
                 <li className="navbar-toggle">
                     <Link to='#' className='menu-bars'>
                     <FaIcons.MdLiveHelp />
                     </Link>
                 </li>
                 {SidebarData.map((SidebarItem, index) => {
                     return (
                         <li key={index} className={SidebarItem.cName}>
                             <Link to={SidebarItem.path}>
                                 {SidebarItem.icon}
                                 <span>{SidebarItem.title}</span>
                             </Link>
                         </li>
                     )
                 })}
                </ul>
            </nav>
            <div className="sidepanel">
                 {SidebarData.map((SidebarItem, index) => {
                     return (
                        <li key={index} className={SidebarItem.cName}>
                            {SidebarItem.profile}
                            <Link to={SidebarItem.path}>
                                {SidebarItem.icon}
                            </Link>
                        </li>
                     )
                 })}
            </div>
            </IconContext.Provider>
        </div>
    );
}

export default NavbarSidebar;
